def getminscore(block):
	return (2**block)*(block-1)-(2**(block-2))*4*2/11

def plotscores(scores, name):
	p = linspace(0, 1, len(scores))
	error = sqrt(p * (1 - p) / len(scores)) * 2
	fill_between(sort(scores)[::-1], 100 * numpy.maximum(0, numpy.minimum(1, p - error)), 100 * numpy.maximum(0, numpy.minimum(1, p + error)), facecolor='gray', alpha=0.15)
	plot(sort(scores)[::-1], linspace(0, 100, len(scores)), label=("%s (%d)" % (name, len(scores))))

